import {FETCH_REPORTS_TYPE_BY_PLAYER_ID,FETCH_ALL_REPORTS_TYPE_BY_REGION} from './actionType';
import axios from 'axios';




export const fetchReportsTypeByPlayerId = (id) => dispatch => {
    const url = 'http://localhost:3001/api/public/v1/reportsType/players/'+id;
    axios.get(url)
        .then(res =>
            dispatch({
                type: FETCH_REPORTS_TYPE_BY_PLAYER_ID,
                payload: res.data
            })
        );   
};

export const fetchAllReportsTypeByRegion = (region) => dispatch => {
    const url = 'http://localhost:3001/api/public/v1/reportsType/regions/'+region;
    axios.get(url)
        .then(res =>
            dispatch({
                type: FETCH_ALL_REPORTS_TYPE_BY_REGION,
                payload: res.data
            })
        );   
};
